import React, { Component, Fragment } from 'react';
import { ValueConsumer } from '../../../Context';
import ItemImg from '../../atoms/main/ItemImg';
import BillItemDetail from '../../molecules/main/BillItemDetail';
import BillItemBtns from '../../molecules/main/BillItemBtns';

import './billItem.scss';

export class BillItem extends Component {

    render() {
        return (
            <div className='billContainer'>
                <ValueConsumer>{value =>
                value.items.map((item, index) => {
                    if (item.count > 0) {
                        return <div key={index} className='billItem'>
                        <ItemImg src={item.src} />
                        <BillItemDetail item={item} />
                    </div>
                    }
                })
            }
            </ValueConsumer>   
            </div>  
        )
    }
}

export default BillItem
